const home = new _HomePage.default();
const auth = new _AuthPage.default();
// --- Generate random user ---
const user = {
  name: _faker.faker.person.firstName() + ' ' + _faker.faker.person.lastName(),
  email: _faker.faker.internet.email(),
  password: _faker.faker.internet.password(),
  day: '15',
  month: '6',
  year: '1995',
  firstName: _faker.faker.person.firstName(),
  lastName: _faker.faker.person.lastName(),
  company: _faker.faker.company.name(),
  address1: _faker.faker.location.streetAddress(),
  address2: _faker.faker.location.secondaryAddress(),
  country: 'Canada',
  state: _faker.faker.location.state(),
  city: _faker.faker.location.city(),
  zipcode: _faker.faker.location.zipCode(),
  mobileNumber: _faker.faker.phone.number()
};
// --- Step 1: Register user first ---
cy.visit('/');
home.getMainBanner().should('be.visible');
home.getSignupLoginButton().click();
auth.getNewUserSignupTitle().should('be.visible');
auth.fillSignupNameEmail(user.name, user.email);
auth.submitSignup();
auth.fillAccountInformation(user);
auth.submitCreateAccount();
auth.getAccountCreatedTitle().should('be.visible');
auth.getContinueButton().click();
cy.contains(`Logged in as ${user.name}`, {
  timeout: 15000
}).should('be.visible');
// Logout so we can access signup again
cy.get('a[href="/logout"]').click();
auth.getLoginTitle().should('be.visible');
// --- Step 2: Try registering again with the same email ---
auth.getNewUserSignupTitle().should('be.visible');
auth.fillSignupNameEmail(user.name, user.email);
auth.submitSignup();
// --- Step 3: Verify error message via page object ---
auth.getSignupError().should('be.visible');
